import './App.css';

function App() {

  const atividades = [
    {
      "id": 1,
      "descricao": "Primeira Atividade"
    },
    {
      "id": 2,
      "descricao": "Segunda Atividade"
    }
  ];

  return (
    <div className="mt-3">
      <ul className="list-group">
        {atividades.map(ativ => (
            <li className="list-group-item">{ativ.descricao}</li>
          ))}
      </ul>
    </div>
  );
}

export default App;
